from collections import deque

def diff(a,b):
    cnt=0
    for i in range(0,len(a)):
         if a[i]!=b[i]:
            cnt+=1
    
    return cnt==1


def solution(begin, target, words):
    if target not in words:
        return 0

    
    #visited 노드 선언
    visited_node={}
    visited_node[begin]=0
    for word in words:
        visited_node[word]=0

    #needed 노드 선언
    needed_node=deque()
    needed_node.append([begin,0])

    while needed_node:
        node,cnt=needed_node.pop()

        if visited_node[node]>0:
            continue
        
        visited_node[node]=cnt

        if node==target:
            break
        for word in words:
            if (visited_node[word]==0) and diff(node,word) :
                needed_node.append([word,cnt+1])

    return visited_node[node]

